import axios from "axios";
import React, { useEffect, useState } from "react";
import Home from "./pages/Home";
import ProjectList from "./pages/ProjectList";
import WorkerLİst from "./pages/WorkerList";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom"



function WorkerList() {
    const [worker, setWorker] = useState([]);

    useEffect(() => {
        axios.get("http://localhost:8080/api/worker/list")
            .then(res => {
                setWorker(res.data);
                console.log("Veri geldi:", res.data);
            })
            .catch(err => {
                console.error("Veri alınırken hata:", err);
            });
    }, []);
    return (
        <div>
            <h2>Çalışan Listesi</h2>
            <ul>
                {worker.map(work => (
                    <li key={work.id}>{work.name}-{work.age}-{work.gender}    </li>
                ))}
            </ul>
        </div>
    )

}

export default WorkerList;
